package com.ikosmo.register;

public class ZipcodeVO {
	private int num;
	private int zipcode;
	private String sido;
	private String sigungu;
	private String um;
	private String doroName;
	private String gunmula;
	private String gunmulb;
	private String gunmulc;
	private String dong;
	public ZipcodeVO() {
		// TODO Auto-generated constructor stub
	}
	public int getNum() {
		return num;
	}
	public void setNum(int num) {
		this.num = num;
	}
	public int getZipcode() {
		return zipcode;
	}
	public void setZipcode(int zipcode) {
		this.zipcode = zipcode;
	}
	public String getSido() {
		return sido;
	}
	public void setSido(String sido) {
		this.sido = sido;
	}
	public String getSigungu() {
		return sigungu;
	}
	public void setSigungu(String sigungu) {
		this.sigungu = sigungu;
	}
	public String getUm() {
		return um;
	}
	public void setUm(String um) {
		this.um = um;
	}
	public String getDoroName() {
		return doroName;
	}
	public void setDoroName(String doroName) {
		this.doroName = doroName;
	}
	public String getGunmula() {
		return gunmula;
	}
	public void setGunmula(String gunmula) {
		this.gunmula = gunmula;
	}
	public String getGunmulb() {
		return gunmulb;
	}
	public void setGunmulb(String gunmulb) {
		this.gunmulb = gunmulb;
	}
	public String getGunmulc() {
		return gunmulc;
	}
	public void setGunmulc(String gunmulc) {
		this.gunmulc = gunmulc;
	}
	public String getDong() {
		return dong;
	}
	public void setDong(String dong) {
		this.dong = dong;
	}
	
}
